import React from 'react';

const Certifications = () => {
  const certifications = [
    {
      title: "Advanced Certificate Program in Data Science",
      issuer: "IIIT Bangalore (upGrad)",
      icon: "fas fa-graduation-cap",
      date: "2025 - Present"
    },
    {
      title: "IEEE Publication",
      issuer: "Self Defence System using Computer Vision and AI",
      icon: "fas fa-file-alt",
      date: "2023"
    },
    {
      title: "Machine Learning Fundamentals",
      issuer: "Online Certification",
      icon: "fas fa-robot",
      date: "2023"
    }
  ];

  return (
    <>
      <section className="page-hero">
        <div className="container">
          <h1>Certifications</h1>
          <p>My certifications and publications</p>
        </div>
      </section>

      <section className="section page-content">
        <div className="container">
          <h2 className="section-title">Certifications & Publications</h2>
          <div className="certifications-grid">
            {certifications.map((cert, index) => (
              <div key={index} className="cert-card">
                <div className="cert-icon">
                  <i className={cert.icon}></i>
                </div>
                <h3 className="cert-title">{cert.title}</h3>
                <p className="cert-issuer">{cert.issuer}</p>
                <span className="cert-date">{cert.date}</span>
              </div>
            ))}
          </div>
        </div>
      </section>
    </>
  );
};

export default Certifications;
